// @name:de             Prime Video Auto Skipper
// @description         Automatically skip intro and ending
// @description:ja      イントロとエンディングを自動でスキップする
// @description:en      Automatically skip intro and ending
// @description:zh-CN   自动跳过介绍和结尾
// @description:ko      인트로와 엔딩을 자동으로 스킵합니다
// @description:ru      Автоматически пропускает интро и окончание
// @description:de      Überspringt automatisch Intro und Ende
// @version             1.1.0
// @author              Yos_sy
// @match               https://www.amazon.co.jp/*
// @namespace           http://tampermonkey.net/
