// ==/UserScript==

(function () {
  "use strict";

  // イントロとエンディングのスキップ機能を提供するクラス
  class IntroEndingSkipper {
    constructor() {
      this.skipEnabled = true; // スキップ機能の有効/無効を制御するフラグ
      this.skipDelay = 3000; // スキップ機能を無効にする期間（ms）
    }

    // イントロのスキップを実行するメソッド
    skipIntro() {
      if (!this.skipEnabled) return; // スキップが無効の場合は処理を中断

      // イントロスキップボタンを探し、存在すればクリック
      const skipButton = document.querySelector(
        "button.fqye4e3.f1ly7q5u.fk9c3ap.fz9ydgy.f1xrlb00.f1hy0e6n.fgbpje3.f1uteees.f1h2a8xb.atvwebplayersdk-skipelement-button.fjgzbz9.fiqc9rt.fg426ew.f1ekwadg"
      );
      if (skipButton) {
        skipButton.click(); // イントロをスキップ
        console.log("Intro skipped"); // スキップ処理をログに記録
        this.disableSkipping(); // スキップ機能を一時的に無効化
      }
    }

    // エンディングのスキップを実行するメソッド
    skipEnding() {
      if (!this.skipEnabled) return; // スキップが無効の場合は処理を中断

      // エンディングスキップボタンを探し、存在すればクリック
      const endingSkipButton = document.querySelector(
        "div.atvwebplayersdk-nextupcard-button.fixbm5z.f1nog967.fobx3y5"
      );
      if (endingSkipButton) {
        endingSkipButton.click(); // エンディングをスキップ
        console.log("Ending skipped"); // スキップ処理をログに記録
        this.disableSkipping(); // スキップ機能を一時的に無効化
      }
    }

    // スキップ機能を一時的に無効にし、指定時間後に再度有効にするメソッド
    disableSkipping() {
      this.skipEnabled = false; // スキップを無効に設定
      setTimeout(() => {
        this.skipEnabled = true; // 指定時間後にスキップ機能を再度有効化
        console.log("Skipping is re-enabled"); // 再有効化をログに記録
      }, this.skipDelay);
    }

    // DOMの変更を監視し、スキップ処理を実行するメソッド
    observe() {
      const observer = new MutationObserver(() => {
        this.skipIntro(); // イントロのスキップ処理
        this.skipEnding(); // エンディングのスキップ処理
      });
      // ドキュメント全体の子要素とサブツリーの変更を監視
      observer.observe(document.body, { childList: true, subtree: true });
    }
  }

  // IntroEndingSkipperのインスタンスを作成し、DOM変更の監視を開始
  const skipper = new IntroEndingSkipper();
  skipper.observe();
})();
